our music video for GIANTS came together thanks to an awesome team, some wild late night ideas, and beautiful art created by our fans.

one night in 2022, i stayed up until sunrise making a flipbook of crappy little sketches on notebook paper to convey this story i’d just seen in my mind’s eye.  the idea would only work, though, if we asked our audience to contribute their own imaginations to the project.

we received hundreds of submissions - beautiful and frightening, creative, emotional artworks of unique Giants.  we could only use a handful for the animation, but they would represent the imagination of the fanbase and the somewhat intense meaning of the lyric, which the fans clearly understood in their own unique ways.

it took months longer than expected but we’re so proud of the result… and we wish we could do a whole feature-length film involving everyone’s drawings.

big shoutout to our director @ninakramerr + animator @madebymaedae, the fans whose work we animated @carmen_yesterday
